import React, { Component } from 'react';
import "../DropDownItem.css"

class Easy extends Component {

    render() {

        return (
            <div className="about-container">
                <h3 className="about-title">Простое оригами</h3>
                <span className="sub-text">История этого стиля началась в Великобритании, где его придумал мастер Джон Смит. Этот вид создания бумажных моделей подходит новичкам и тем, кто в силу физических недостатков не способен использовать двигательные навыки. Такие люди не могут освоить сложные приемы, а значит, для них требуется придумывать новые методы, которые дают аналогичные результаты в итоге.</span>
            </div>
        );
    }
}


export default Easy;
